              placeholder='Input test 2'
            />
            <Error
              name='test2'
              types={{
                required: 'Test es requerido',
                maxLength: 'Solo hasta 5 caracteres'
              }}
            />
          </Track>
          <Track>
            <input type='submit' />
          </Track>
        </Flex>
      </Form>
    </Box>
  )
}
